import _ from 'lodash';
import { AccountsCommon } from 'meteor/accounts-base'

if(Meteor.isServer) {
	let LOG_TAG = "config-user-accounts";
	//console.log(LOG_TAG,"Meteor is server");
	Accounts.onCreateUser((options, user) => {
		console.log(LOG_TAG,"onCreateUser",options);
		console.log(LOG_TAG,"onCreateUser user",user);
	  	// add your extra fields here; don't forget to validate the options, if needed
	 	user.profile = options.profile || {};
	 	let dummyPedometerData = [];
	 	let startOfDay = new Date();
        	startOfDay.setHours(0,0,0,0);
	 	for (var i = 0; i<= 24 ; i++) {

	 		var daysAgo = startOfDay - (i*24*60*60*1000);
        	console.log(LOG_TAG,i + " days ago " + new Date(daysAgo).getTime())
        	var dateDaysAgo = new Date(daysAgo).getTime();
	 		let pedometerData = {
	 			'steps' : getRandomInt(0, 10000),
	 			'day' : dateDaysAgo,
	 			'kCalBurned' : getRandomInt(0, 4000),
	 			'timeActive' : getRandomInt(0, 43200) //12 hours
	 		}
	 		dummyPedometerData.push(pedometerData);
	 	}
	  	_.extend(user, {
		    status: false,
		    createdAt: new Date(),
		    myField : [1,2,3],
		    pedometerData: dummyPedometerData,
		    //profilePictureBase64 :  ''

	 	});
		// profile picture base 64 works but it is annoying in the logs
	 	_.extend(user.profile, {
	 		'height' : 150,
	 		'weight' : 55.5
	 	});
	 	if (user.username) {
		 	_.extend(user.profile, {
		 		'name' : user.username
		 	});
	 	}

	  	console.log(LOG_TAG,"modified user",user);

	  	return user;
	});





	/**********
		display online/offline text and icon
		******/
	Accounts.onLogin(function(user) {
		//console.log("onLogin server user",user)
		//console.log("db",Meteor.users);
		Meteor.users.update({_id : user.user._id}, {
			$set : {
				'status' : true
			}
		})
	})
	Accounts.onLogout(function(user) {
		//console.log("onLogout server user",user)
		//console.log("db",Meteor.users);
		Meteor.users.update({_id : user.user._id}, {
			$set : {
				'status' : false
			}
		})
	})
}

if(Meteor.isClient) {
	console.log("isClient")
	AccountsCommon.onLogin(function() {
		console.log("onLogin");
	})
}

function getRandomInt(min, max) {
  return Math.floor(Math.random() * (max - min)) + min;
}